import React, { Component } from 'react'

export default class OrderDetails extends Component {
    constructor() {
        super()
        this.state = {
            details: ""
        }
    }

    componentDidMount() {
        fetch('/all/listing')
            .then(res => res.json())
            .then(res => {
                console.log(res)
                this.setState({
                    details: res
                })
            })
    }
    render() {

        return (
            <div>

            </div>
        )
    }
}
